def pf(s): return print(s, flush=True)

def main():
    rr = []
    mk = {}
    mk['T'] = 10
    mk['J'] = 11
    mk['Q'] = 12
    mk['K'] = 13
    mk['A'] = 14
    for i in range(1,10):
        mk[str(i)] = i

    while True:
        t = S()
        if t == '#':
            break
        a = [list(map(lambda x: (mk[x[0]], x[1]), LS())) for _ in range(4)]
        d = 0
        ns = 0
        ew = 0
        for i in range(13):
            m = -1
            mi = -1
            it = a[d][i][1]
